const e={title:"Introducción al Rol de Engineering Manager",speaker:[{image:"miguel-garcia.jpg",name:"Miguel García Lorenzo",link:"https://www.linkedin.com/in/mgarlorenzo/"},{image:"lucia-perez.jpg",name:"Lucia Pérez Fernández",link:"https://www.linkedin.com/in/luc%C3%ADa-p%C3%A9rez-fern%C3%A1ndez-2279a177/"}],description:["Este taller te proporcionará un viaje dinámico y divertido a través de la gestión de equipos de ingeniería, ofreciendo conocimientos teóricos y prácticos que te ayudarán a descubrir el rol de Engineering Manager y afrontar los retos del día a día si decides tomar este camino profesional.","El viaje comienza con una introducción en la que se abordan los primeros pasos para posteriormente  avanzar hacia temas más interesantes como One-to-One, resolución de problemas o liderazgo. La última parada de este viaje nos llevará a visitar partes menos actractvias del rol como pueden ser abordar situaciones de bajo rendimiento en el equipo o la salud mental del propio manager.","¡Súbete y disfruta del viaje!"],schedule:"Viernes 12:00-14:00",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1676947064109019138","https://twitter.com/phpulpocon/status/1678660514036043776"]},a={title:"Arquitectura en la nube con bridas y cinta americana",speaker:[{image:"anastasia.jpg",name:"Anastasia Kondratieva",link:"https://twitter.com/AnastasiaKnt"}],description:["En este taller vamos a hacernos una pregunta ¿qué harías si tuvieras que montar la infraestructura de una empresa entera desde cero en AWS? Planificaremos la arquitectura, mezclaremos el cemento, levantaremos las paredes...y porque no, usaremos un poco de cinta americana aquí y allá para disimular desperfectos. Será un viaje interactivo en el que lxs participantes votarán sobre los caminos que vamos a ir tomando y hablaremos de las consecuencias de nuestras decisiones."],schedule:"Viernes 16:00-18:00",track:"DevOps",twitter:["https://twitter.com/phpulpocon/status/1667565373003104259"]},o={title:"Agua, Aire, Tierra y Fuego",speaker:[{image:"mavi.jpg",name:"Mavi Jimenez",link:"https://twitter.com/linkita"}],description:["La parte más complicada a la hora de hacer funcionar un proyecto, es la comunicación y las relaciones entre las personas. ¿Realmente debemos tratar a los demás como nos gusta que nos traten a nosotros?","En este taller, exploraremos en profundidad los diversos tipos de personas que pueden conformar un equipo, incluyéndonos a nosotras mismas, y aprenderemos cómo establecer relaciones efectivas con cada una de ellas. Descubriremos qué aspectos observar, cómo acercarnos de manera adecuada y cómo interpretar las sutilezas de cada tipo de interacción. Para lograr este propósito, nos apoyaremos en DISC, una poderosa herramienta de autoconocimiento y comprensión del entorno, que nos brindará la capacidad de construir puentes entre los diferentes elementos."],schedule:"Viernes 9:30-11:30",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1668313122451468289"]},n={title:"Taller de reliability testing con Grafana k6",speaker:[{image:"imma-valls.jpg",name:"Imma Valls",link:"https://twitter.com/eyeveebee"}],description:["Grafana k6 (http://k6.io) es una herramienta de código abierto inicialmente diseñada para la realización de pruebas de carga y rendimiento. Es especialmente útil para developers y SREs (Site Reliability Engineers) que deseen evaluar y analizar el desempeño de sus aplicaciones.","k6 destaca por un alto rendimiento (desarrollada en Go), el enfoque basado en código (las pruebas se scriptan en Javascript ES6), gran facilidad para automatizar (CLI e integraciones con CI/CD), soporte para múltiples protocolos, flexibilidad en el almacenamiento y visualización de métricas.","En este taller práctico comprobarás cómo k6 puede ayudarte no solo a con el rendimiento, sino en la prevención de fallos, detección de regresiones y a desplegar tus aplicaciones con mayor confianza.","Pre-requisitos a instalar: Docker y Git."],schedule:"Viernes 12:00-14:00",track:"DevOps",twitter:["https://twitter.com/phpulpocon/status/1674401667188400129"]},r={title:"Dagster",speaker:[{image:"julien.jpg",name:"Julien Vantyghem",link:"https://twitter.com/JulienVantyghem"},{image:"david-fernandez.jpg",name:"David Fernández Calle",link:"https://www.linkedin.com/in/davidfernandezcalle/"}],description:[""],schedule:"Viernes 12:00-14:00",track:"Data",twitter:["https://twitter.com/phpulpocon/status/1679035108551008257"]},s={title:"Porque no todo es luz y unicornios en el camino del manager",speaker:[{image:"ricard-clau.jpg",name:"Ricard Clau",link:"https://twitter.com/ricardclau"}],description:["Cuanto más alta es tu posición en la empresa, más complicado es encontrar ayuda. Muchos dicen que lo peor de ser CTO es que estás solo.","Aprovechemos que estamos unos cuantos managers para hablar de todo aquello que nos preocupa, desde las responsabilidades inesperadas hasta temás “tabú” que siempre nos dan reparo como los despidos. Perdamos el miedo a hablar."],schedule:"Viernes 16:00-18:00",track:"Management",twitter:["https://twitter.com/phpulpocon/status/1674055466840649731"]},t={title:"Micro-frontends: Divide the monolith and conquer",speaker:[{image:"yahima.jpg",name:"Yahima Duarte Perez",link:"https://twitter.com/layahi82"}],description:["Hoy en día, las aplicaciones se han vuelto increíblemente grandes y complejas, y la mayor parte son desarrolladas del lado del cliente. Se está volviendo muy difícil mantener esas aplicaciones y, a menudo, creamos más errores de los que arreglamos. En esta presentación, exploraremos los conceptos clave y beneficios de la arquitectura micro-frontend y discutiremos cómo se puede implementar en la práctica, cuando vale la pena usarla y que buenas practicas podriamos seguir al implementarla incluyendo una demo corta de como la he implementado yo en experiencias pasadas."],schedule:"Viernes 9:30-10:15",track:"La Pulpito",twitter:["https://twitter.com/phpulpocon/status/1676192556470738949"]},i={title:"Product Driven Development",speaker:[{image:"ana-carmona.jpg",name:"Ana Carmona",link:"https://twitter.com/nhan_bcn"}],description:["¿Entendemos que es exactamente desarrollar producto?","¿Qué implica?","¿En qué nos beneficia  tener mentalidad de producto?","En este taller haremos un ejercicio que nos ayudará a acercarnos a la mentalidad de producto desde el punto de vista de un desarrollador."],schedule:"Viernes 9:30-11:30",track:"Crafter",twitter:["https://twitter.com/phpulpocon/status/1669421244314275866"]},c={title:"Legacy Code: Guia de supervivencia",speaker:[{image:"javier-chacana.jpg",name:"Javier Chacana",link:"https://twitter.com/jchacana"}],description:["Haremos un repaso rápido por distintas técnicas de supervivencia y cómo aplicarlas para reducir riesgo y frustración, ejemplificando en una base de código real (o que luce como una real). Intentaré que no sean ejemplos de laboratorio. Ideal para gente que ha trabajado sólo en proyectos greenfield o para gente que llega a apagar fuegos."],schedule:"Viernes 12:00-14:00",track:"Crafter",twitter:["https://twitter.com/phpulpocon/status/1686764003467411456"]},l={title:"¿Qué pasa cuando no hay tiempo para ser crafter?",speaker:[{image:"rolando-caldas.jpg",name:"Rolando Caldas",link:"https://twitter.com/rolando_caldas"}],description:["Si trabajas o has trabajado en las fases iniciales de una startup sabrás que al principio todo es caos, los requerimientos no son claros, el dominio es una ilusión, la incertidumbre es tu día a día y eso que llaman “pivotar” hace que lo cambies todo en cuestión de horas.","Por eso es común que cuando llega el momento de que por fin encuentras tu camino... ese “MVP” es lo más parecido al big ball of mud que has visto jamás... y toca refactorizar para poder orden y empezar a aplicar pensamiento crafter: Testing, desacoplar, arquitectura hexagonal (o algo así), etc.","El objetivo de este taller es coger una aplicación real acoplada hasta la médula al framework e ir trabajando en una pequeña parte para ir refactorizándola hacia lo que sería un monolito modular aplicando TDD outside-in, hexagonal, CQS (o CQRS), etc.","¿Y qué aplicación real es esa? Pues el portal de venta de entradas de la pulpoCon. 100% real y operativa. ¿te apuntas al reto?"],schedule:"Jueves 9:30-18:00 y Viernes 9:30-18:00",track:"Crafter Fullstack",twitter:["https://twitter.com/phpulpocon/status/1675089260142108673"]},d={title:"Guardianes de Datos: Innovando en ciberseguridad con Data Analytics & IA",speaker:[{image:"shenia-kuchumova.jpg",name:"Shenia Kuchumova",link:"https://www.linkedin.com/in/shenia-kuchumova-96330b226"},{image:"iago-abad.jpg",name:"Iago Abad",link:""}],description:["En este taller veremos cómo aplicar modelos y técnicas de machine learning de forma sencilla y metódica a nuestros datos desde el punto de vista de la seguridad. Indagaremos en conceptos como la privacidad y la anonimización: por qué y cuándo debemos emplearla, cómo se mide… Y, además, veremos cómo podemos detectar anomalías (¡y potenciales ataques!) en información que solemos tener disponible, como los logs, tráfico de red o actividad de usuario de nuestras aplicaciones. Aprendemos a proteger nuestros datos, y que nuestros datos nos protejan a nosotros."],schedule:"Viernes 09:30-11:30",track:"Data",twitter:[]},p={title:"Observabilidad, OpenTelemetry, ... ¿Que me estás contando?",speaker:[{image:"maria-romero.jpg",name:"Maria Romero",link:"https://twitter.com/marromang"}],description:["Este taller tendrá una parte práctica donde de forma sencilla aprenderemos los términos básicos, en qué nos pueden ayudar, cómo pelear y ganar la batalla. También tendrá una espacio para que podamos compartir experiencias, si lo usamos o no y por qué, formas de implantarlo y todo lo que se nos ocurra."],schedule:"Viernes 9:30-11:30",track:"DevOps",twitter:["https://twitter.com/phpulpocon/status/1688592836789256195"]},m={title:"“Esto antes funcionaba”: un viaje sin fin a través del modelado físico, Python y la desesperación.",speaker:[{image:"sara-recondo.jpg",name:"Sara Recondo",link:"https://www.linkedin.com/in/srecondo/"},{image:"sara-sanchez.jpg",name:"Sara Sanchez",link:"https://www.linkedin.com/in/sara-sanchez-pineiro/"}],description:["En esta charla explicaremos qué pasos seguir para convertir “física” en “código” basándonos en un caso real: la propagación y recepción de ondas acústicas en el agua."],schedule:"Viernes 10:10-10:50",track:"La Pulpito",twitter:[]},u={title:"¡De lo Transaccional a lo Analítico!: La epopeya de nuestra migración tecnológica.",speaker:[{image:"dario-cazas.jpg",name:"Dario Cazás",link:"https://www.linkedin.com/in/dcazas/"},{image:"miguel-garcia.jpg",name:"Miguel García Lorenzo",link:"https://www.linkedin.com/in/mgarlorenzo/"}],description:["¿Alguna vez has observado como se ensambla un avión en pleno vuelo?","Así es como sentimos nuestra migración desde una base de datos puramente transaccional a una analítica. En esta charla compartiremos con vosotros el viaje lleno de desafios al que nos enfrentamos, como resolvimos algunos de estos retos y como en este viaje acabamos transformando toda nuestra plataforma."],schedule:"Viernes 10:50-11:30",track:"La Pulpito",twitter:[]},g={title:"Alertas, Pánico y Solución",speaker:[{image:"valvanera-gijon.jpg",name:"Valvanera Gijon",link:"https://www.linkedin.com/in/valvanera-gij%C3%B3n-jim%C3%A9nez-651368171/"}],description:["Cómo gestionar alerta de funcionalidad estando preparados para su rápida solución"],schedule:"Viernes 12:00-12:40",track:"La Pulpito",twitter:[]},h={title:"Elasticsearch: Motor de búsqueda en vectores y híbrido",speaker:[{image:"janko-strassburg.jpg",name:"Janko Strassburg",link:"https://www.linkedin.com/in/janko-strassburg-a1138250/"}],description:["La búsqueda de vectores aprovecha el machine learning (ML) para capturar el significado y el contexto de los datos no estructurados, incluido el texto y las imágenes, y transformarlos en una representación numérica. La búsqueda de vectores, que se usa con frecuencia para la búsqueda semántica, encuentra datos similares usando algoritmos de vecino más cercano aproximado (ANN). En comparación con la búsqueda de palabras clave tradicional, la búsqueda de vectores logra resultados más relevantes y se ejecuta más rápido."],schedule:"Viernes 12:40-13:20",track:"La Pulpito",twitter:[]},v={title:"From Zero to Hero ",speaker:[{image:"adrian-alonso.jpg",name:"Adrián Alonso Vega",link:"https://www.linkedin.com/in/adrianalonsovega/"}],description:["En esta charla, exploraremos el camino que un developer recorre desde sus inicios en el sector hasta alcanzar el rol de Tech Lead. Analizaremos las características clave de los developers, identificaremos los arquetipos de los Engineering Managers y descubriremos herramientas que pueden ser útiles al asumir roles de gestión."],schedule:"Viernes 13:20-14:00",track:"La Pulpito",twitter:[]},k={title:"Testing the untestable code",speaker:[{image:"yondra-lopez.jpg",name:"Yodra López",link:"https://twitter.com/yodralopez"}],description:["El código legado suele ser difícil de testear, y refactorizarlo directamente supone un riesgo grande, ya que podemos romper funcionalidad. Trabajaremos con un código legacy sin test, veremos una técnica llamada scaffolding tests para crear tests que nos permitirán refactorizar el código sin romper su funcionalidad."],schedule:"Viernes 16:00-18:00",track:"Crafter",twitter:[]},y={title:"Ingenería de prompt de ChatGPT",speaker:[{image:"maryna-bogdan.jpg",name:"Maryna Bogdan",link:"https://www.linkedin.com/in/maryna-bogdan/"}],description:['En "Ingenería de prompt de ChatGPT para desarrolladores" vas a aprender:',"- a usar gran modelo de lenguaje (LLM) para crear nuevas aplicaciones;","- dos principios clave para escribir prompts efectivos y como diseñar sistemáticamente buenas prompts;","- mejores practicas para usar prompts.","Todos los conceptos se ilustran con ejemplos y puedes interactuar directamente en el entorno de notebook Jupyter para obtener experiencia práctica con ingenería rápida."],schedule:"Viernes 16:00-18:00",track:"Data",twitter:[]},b={title:"Open mic technical session",description:["Tú puedes convertirte en speaker de la #pulpoCon23!!!","Durante todo el jueves y viernes podrás apuntarte en nuestro panel de “open talks”. Las charlas, de 15 minutos de duración máximo, podrán ser votadas por todas las asistentes a la pulpo y el viernes, tras la comida, si estás entre las más votadas tendrás la oportunidad de exponer tu charla en la pulpito."],schedule:"Viernes 16:00-18:00",track:"La Pulpito",twitter:[]},w={title:"From Zero to Hero ",speaker:[{image:"ruben-del-campo.jpg",name:"Ruben del Campo",link:"https://www.linkedin.com/in/rdelcampog/"}],description:["¿Cómo afrontar el reto de un SaaS de web scrapping que pueda escalar a millones de peticiones por minuto?","¿Cómo superar los desafíos de procesamiento de datos, rendimiento, distribución de carga, etc?","Trade-offs y lecciones aprendidas en el mundo real desde un equipo chaos-driven."],schedule:"Viernes 18:00-18:40",track:"La Pulpito",twitter:[]},f={"miguel-lucia":e,"anastasia-kondratieva":a,"mavi-jimenez":o,"imma-valls":n,"julien-david":r,"ricard-clau":s,"yahima-duarte":t,"ana-carmona":i,"javier-chacana":c,"rolando-caldas":l,"shenia-iago":d,"maria-romero":p,"sara-sara":m,"dario-miguel":u,"valvanera-gijon":g,"janko-strassburg":h,"adrian-alonso":v,"yondra-lopez":k,"maryna-bogdan":y,"open-mic":b,"ruben-del-campo":w};export{f as w};
